        internal static BoFldSubTypes Get_Field_Sub_Type(Field_Definition OneField)
        {
            if (OneField.Field_Name.IndexOf("PHOTO") != -1)
            {
                return BoFldSubTypes.st_Link;
            }
            if (OneField.Data_Type == BoFieldTypes.db_Float)
            {
                return BoFldSubTypes.st_Sum;
            }
            else
            {
                return BoFldSubTypes.st_None;
            }
        }

        internal static int Get_Field_Size(Field_Definition OneField, int Length = 0)
        {
            if (Length != 0)
            {
                return Length;
            }
            if (OneField.Data_Type == BoFieldTypes.db_Alpha)
            {
                if (OneField.Length != 0)
                {
                    return OneField.Length;
                }
                return 254;
            }
            else if (OneField.Data_Type == BoFieldTypes.db_Numeric )
            {
                return 11;
            }
            else
            {
                return 0;
            }
        }
    }
